import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store';
import Layout from './components/common/Layout';
import Login from './components/auth/Login';
import JobsBoard from './components/jobs/JobsBoard';
import JobDetail from './components/jobs/JobDetail';
import CandidatesList from './components/candidates/CandidatesList';
import CandidateProfile from './components/candidates/CandidateProfile';
import AssessmentBuilder from './components/assessments/AssessmentBuilder';
import AssessmentForm from './components/assessments/AssessmentForm';
import { useAppSelector } from './hooks/redux';

const ProtectedRoute: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const { isAuthenticated } = useAppSelector((state) => state.auth);
  return isAuthenticated ? <>{children}</> : <Navigate to="/login" />;
};

const AppRoutes: React.FC = () => {
  const { user } = useAppSelector((state) => state.auth);

  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      <Route path="/" element={
        <ProtectedRoute>
          <Layout />
        </ProtectedRoute>
      }>
        {user?.role === 'hr' ? (
          <>
            <Route index element={<Navigate to="/jobs" />} />
            <Route path="jobs" element={<JobsBoard />} />
            <Route path="jobs/:jobId" element={<JobDetail />} />
            <Route path="candidates" element={<CandidatesList />} />
            <Route path="candidates/:candidateId" element={<CandidateProfile />} />
            <Route path="assessments/:jobId" element={<AssessmentBuilder />} />
          </>
        ) : (
          <>
            <Route index element={<CandidateDashboard />} />
            <Route path="jobs" element={<CandidateJobsBoard />} />
            <Route path="assessment/:jobId" element={<AssessmentForm />} />
          </>
        )}
      </Route>
    </Routes>
  );
};

// Placeholder components for candidate views
const CandidateDashboard: React.FC = () => {
  return (
    <div className="max-w-4xl mx-auto">
      <h1 className="text-2xl font-bold text-gray-900 mb-6">Candidate Dashboard</h1>
      <div className="bg-white shadow rounded-lg p-6">
        <p className="text-gray-600">Welcome to your candidate dashboard!</p>
        <p className="text-gray-600 mt-2">This is where you'll see your applications and assessments.</p>
      </div>
    </div>
  );
};

const CandidateJobsBoard: React.FC = () => {
  return (
    <div className="max-w-6xl mx-auto">
      <h1 className="text-2xl font-bold text-gray-900 mb-6">Available Jobs</h1>
      <div className="bg-white shadow rounded-lg p-6">
        <p className="text-gray-600">Browse and apply to available job positions.</p>
        <p className="text-gray-600 mt-2">This feature is coming soon!</p>
      </div>
    </div>
  );
};

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <Router>
        <div className="min-h-screen bg-gray-50">
          <AppRoutes />
        </div>
      </Router>
    </Provider>
  );
};

export default App;
